import logo from './logo.svg';
import './App.css';
import { useEffect } from 'react';

function App() {
  const[template, setTemplate] = useState([]);
  useEffect(() => {
    fetch('https://api.imgflip.com/get_memes').then(x  =>
    x.json().then(response => setTemplate(response.data.memes))
    );
  },[]);
  return (
    <div className="App">
      {
        !templatetemplate.map(template =>{
          return(
            <img key={template.id} src={template.url} alt=''

            onClick={() =>{
              setTemplate(template)
            }}
            />
          )
        })
      }

    </div>
  );
}

export default App;
